import React, { Component } from 'react';
class Shadow extends Component {
	state = {};
	render() {
		let divStyle = {
			height: this.props.height,
			width: this.props.width
		};
		let shadow;
		return (
			<svg className="drawing" onClick={this.props.onClick} onMouseMove={this.props.onMouseMove} style={divStyle}>
				{shadow}
			</svg>
		);
	}
}

export default Shadow;
